Optionally, the User can tap to select any Contacts which they want to be automatically added to the new Group.\
Tapping again will deselect a Contact.\
A device shake will select all Contacts. A second device shake will deselect all Contacts. Each subsequent device shake will toggle between the two states, either; "all selected" or "none selected".}

