\f0\i\fs30 \cf2 \expnd0\expndtw0\kerning0
The title of the "Home" screen in the screen mock-up above is "All Contacts". Is this confusing? Should it be "Home"? The User will probably very quickly "get" that the "Home" screen displays all Contacts, so should we be more consistent and just title this screen "Home"? Or how about "Home (All)"?}

{\rtf1\ansi\ansicpg1252\cocoartf1187\cocoasubrtf340
\cocoascreenfonts1{\fonttbl\f0\fnil\fcharset0 Miso;}
{\colortbl;\red255\green255\blue255;\red25\green25\blue25;}
\pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720\slleading-300\pardirnatural

\f0\i\fs30 \cf2 \expnd0\expndtw0\kerning0
The A-Z Index control is very useful, but if it is permanently displayed, it seems like it will spend a lot of time getting in the way, potentially obscuring other interface elements but also adding unnecessary clutter. I rather like the idea of hiding this control until the list is scrolled, at which point you could fade-in the control, and then after a period of inactivity, fade the control out again. My thinking here is that scrolling the list is a sure sign that the user is looking for someone who they can't currently see on-screen. Surely it's at this point that the A-Z index control might become useful? Also, our list isn't just a list, it's an "information centre", very much like a status board - it communicates important information about the Contacts currently displayed on-screen. If the A-Z Index control is permanently displayed, then surely the app's ability to communicate this information is compromised because it gets in the way?}

